import React, { Component } from 'react'

class ProfileTabs extends Component {
  render() {
    return(
      <div>
        <div className="profile-tabs">
          <ul>
            <li className="waves-effect"> Bio </li>
            <li className="waves-effect"> Followers </li>
            <li className="waves-effect"> Art Works </li>
            <li className="waves-effect"> Collections </li>
          </ul>
        </div>
      </div>
    )
  }
}

export default ProfileTabs
